function var_0_58.faq()
	local var_99_0 = "{EEEEEE}Данная система поможет бороться с ботами, которые регистрируют аккаунты с целью спама игрокам или администраторам,\nнапример, для размещения нежелательной рекламы в своём нике.\n\n{00FF00}Паттерн{EEEEEE} - это часть ника, по которой можно определить, является ли аккаунт ботом.\nРассмотрим пример: регистрируется аккаунт с ником {FFDD90}fdbda_tg_@arztools{EEEEEE}. Сразу становится понятно,\nчто это бот, пытающийся прорекламировать свой телеграм-канал. Указываем паттерн: {FF6060}tg_@arztools{EEEEEE}\nи теперь скрипт начнёт блокировать все последующие новые аккаунты, в чьих никах соддержится данный паттерн.\n\n{00FF00}Причина{EEEEEE} - это причина, по которой скрипт банит бота.\n\n{5FA36A}Если ваш уровень - 5 (Куратор) или выше, то скрипт автоматически перейдет в режим HARD-банов.\nЭто означает, что боты будут блокироваться с помощью метода /banipoff + /banoff на 2000 дней."

