function getIpInfo(ip)
	local result = {
		ok = false,
		ip = ip,
		as = "Неизвестно",
		country = "Неизвестно",
		city = "Неизвестно",
		region = "Неизвестно",
		lat = 0,
		lon = 0,
		proxy = false,
		mobile = false
	}
	
	if not ip or tostring(ip) == "" then
		return result
	end
	
	local url = ("http://ip-api.com/json/%s?fields=status,message,country,city,regionName,lat,lon,as,isp,org,proxy,mobile,hosting,query"):format(ip)
	var_0_21.netlog(0, "IP INFO", "Запрос к ip-api: " .. ip)

	local done = false
	local resp = nil
	local error_occurred = false
	
	asyncHttpRequest("GET", url, {
		timeout = 10,
		headers = {
			["user-agent"] = net.user_agent or "Mozilla/5.0"
		}
	}, function(r)
		if r then
			resp = r
		end
		done = true
	end, function(err)
		error_occurred = true
		var_0_21.netlog(2, "IP INFO", "Ошибка запроса: " .. tostring(err))
		done = true
	end)
	
	local started = os.clock()
	local max_wait = 10
	while not done and os.clock() - started < max_wait do
		wait(100)
	end
	
	if error_occurred or not done then
		var_0_21.netlog(2, "IP INFO", "Таймаут или ошибка запроса")
		return result
	end
	
	if not resp or resp.status_code ~= 200 or not resp.text then
		var_0_21.netlog(2, "IP INFO", "Ошибка запроса: статус " .. tostring(resp and resp.status_code or "nil"))
		return result
	end

	local ok, data = pcall(decodeJson, resp.text)

	if not ok or type(data) ~= "table" then
		var_0_21.netlog(2, "IP INFO", "Ошибка парсинга JSON")
		return result
	end
	
	if data.status ~= "success" then
		var_0_21.netlog(2, "IP INFO", "Ошибка ответа: " .. tostring(data.message or "unknown"))
		return result
	end
	
	result.country = data.country or result.country
	result.city = data.city or result.city
	result.region = data.regionName or result.region
	result.lat = tonumber(data.lat) or 0
	result.lon = tonumber(data.lon) or 0

	local as_name = data["as"] or data.isp or data.org
	if type(as_name) == "string" and as_name ~= "" then
		result.as = as_name
	end

	result.proxy = data.proxy == true or data.hosting == true
	result.mobile = data.mobile == true
	result.ok = true

	var_0_21.netlog(1, "IP INFO", "OK: " .. result.country .. ", " .. result.city)
	
	return result
end
