-- Локальное хранилище частиц только для окна репорта
local report_dots = {}

function report_particles(win_pos, win_size, text, speed, count, r, g, b, a)
	local draw_list = var_0_8.GetWindowDrawList()
	local text_size = var_0_8.CalcTextSize(text)
	local cursor_pos = var_0_8.GetCursorPos()
	local window_pos = win_pos

	local function get_min_dist(point)
		local dx1 = point.x - cursor_pos.x
		local dy1 = point.y - cursor_pos.y
		local dx2 = (win_pos.x + win_size.x) - point.x
		local dy2 = (win_pos.y + win_size.y) - point.y
		return math.min(dx1, dy1, dx2, dy2)
	end

	local function shift_point(p, offset)
		return p, var_0_8.ImVec2(p.x + offset.x, p.y + offset.y)
	end

	for i = 1, count do
		if report_dots[i] == nil then
			-- Инициализация новой частицы
			local offset_x = 10 + math.random(0, 20)
			local vector = var_0_8.ImVec2(offset_x, 40)
			local start_x = math.random(win_pos.x, win_pos.x + win_size.x)
			local start_y = math.random(win_pos.y, win_pos.y + win_size.y)
			local pos1 = var_0_8.ImVec2(start_x, start_y)
			local pos2 = var_0_8.ImVec2(pos1.x + vector.x, pos1.y + vector.y)

			report_dots[i] = {
				pos_1 = pos1,
				pos_2 = pos2,
				vector = vector,
				scale = math.random(5, 10) / 10,
				clock = os.clock()
			}
		else
			::retry::

			local duration = 1 / speed / report_dots[i].scale
			local current_pos, state = EaseVec2(report_dots[i].pos_1, report_dots[i].pos_2, report_dots[i].clock, duration)

			if state == 2 then
				-- Цикл завершён — сдвинуть траекторию
				report_dots[i].pos_1, report_dots[i].pos_2 = shift_point(report_dots[i].pos_2, report_dots[i].vector)
				report_dots[i].clock = os.clock()
				goto retry
			end

			-- Обработка выхода за границы окна репорта
			local clamped_pos = var_0_8.ImVec2(current_pos.x, current_pos.y)

			if current_pos.x < win_pos.x then
				clamped_pos.x = win_pos.x + win_size.x
			elseif current_pos.x > win_pos.x + win_size.x then
				clamped_pos.x = win_pos.x
			end

			if current_pos.y < win_pos.y then
				clamped_pos.y = win_pos.y + win_size.y
			elseif current_pos.y > win_pos.y + win_size.y then
				clamped_pos.y = win_pos.y
			end

			if clamped_pos.x ~= current_pos.x or clamped_pos.y ~= current_pos.y then
				report_dots[i].pos_1, report_dots[i].pos_2 = shift_point(clamped_pos, report_dots[i].vector)
				report_dots[i].clock = os.clock()
				goto retry
			end

			-- Отрисовка частицы
			local alpha = a * report_dots[i].scale
			local dist = get_min_dist(current_pos)
			local fade_dist = 20

			if dist <= fade_dist then
				alpha = alpha * (dist / fade_dist)
			end

			var_0_8.SetWindowFontScale(report_dots[i].scale)
			local centered = var_0_8.ImVec2(
				current_pos.x - text_size.x / 2,
				current_pos.y - text_size.y / 2
			)
			draw_list:AddText(
				var_0_8.ImVec2(window_pos.x + (centered.x - win_pos.x), window_pos.y + (centered.y - win_pos.y)),
				join_argb(alpha, r, g, b),
				text
			)
			var_0_8.SetWindowFontScale(1)
		end
	end
end

