		chatSuccess("Система cgetaction запущена. Для остановки введите /cgetaction")

		cgetaction_cache.thread = lua_thread.create(function()
			while cgetaction_active and not cgetaction_cache.stop_thread do
				local next_id = math.random(0, max_player_id)

				while cgetaction_active and not cgetaction_cache.stop_thread and (not sampIsPlayerConnected(next_id) or cgetaction_cache.processed_ids[next_id]) do
					next_id = math.random(0, max_player_id)

					local processed_count = 0
					for _ in pairs(cgetaction_cache.processed_ids) do processed_count = processed_count + 1 end
					if processed_count >= total_players then
						cgetaction_cache.processed_ids = {}
						chatInfo("Все игроки обработаны, начинаем заново.")
						break
					end
				end

				if not cgetaction_active or cgetaction_cache.stop_thread then break end

				cgetaction_cache.processed_ids[next_id] = true
				cgetaction_cache.current_id = next_id

				-- log checked id with nickname if available
				do
					local nick = "N/A"
					local ok, n = pcall(sampGetPlayerNickname, next_id)
					if ok and n and type(n) == "string" then nick = n end
					local f = io.open(getWorkingDirectory() .. "/Primorskiy Tools/cgetaction.log", "a+")
					if f then
						f:write(os.date("%Y-%m-%d %H:%M:%S") .. " | CHECK ID=" .. tostring(next_id) .. " NICK=" .. tostring(nick) .. "\n")
						f:close()
					end
				end

				sampSendChat("/getaction " .. next_id)

				local timeout = 5000
				local waited = 0
				while waited < timeout and cgetaction_active and not cgetaction_cache.stop_thread do
					wait(100)
					waited = waited + 100
				end
			end

			cgetaction_cache.thread = nil
		end)
	end)
